function getColorIndiceProd(IND_PROD) {
    switch (true) {
        case (IND_PROD >= 0 && IND_PROD <= 3):
            return { color: "#5A1A00" };
        case (IND_PROD > 3 && IND_PROD <= 9):
            return { color: "#8B2B00" };
        case (IND_PROD > 9 && IND_PROD <= 16):
            return { color: "#B13600" };
        case (IND_PROD > 16 && IND_PROD <= 23):
            return { color: "#D74600" };
        case (IND_PROD > 23 && IND_PROD <= 30):
            return { color: "#FF6600" };
        case (IND_PROD > 30 && IND_PROD <= 37):
            return { color: "#FFA500" };
        case (IND_PROD > 37 && IND_PROD <= 45):
            return { color: "#FFD700" };
        case (IND_PROD > 45 && IND_PROD <= 52):
            return { color: "#FFFF00" };
        case (IND_PROD > 52 && IND_PROD <= 59):
            return { color: "#D4F900" };
        case (IND_PROD > 59 && IND_PROD <= 66):
            return { color: "#A7F600" };
        case (IND_PROD > 66 && IND_PROD <= 74):
            return { color: "#5DF100" };
        case (IND_PROD > 74 && IND_PROD <= 85):
            return { color: "#00E100" };
        case (IND_PROD > 85 && IND_PROD <= 95):
            return { color: "#00C800" };
        default:
            return { color: "#000000" }; // Color por defecto en caso de que no haya coincidencia
    }
}


function styleSuelos(feature) {
    const { color } = getColorIndiceProd(feature.properties.IND_PROD);
    return {
      color: color,
      weight: 2,
      opacity: 0.9,
      dashArray: "0",
      fillOpacity: 0.9,
    };
  }

